import React from "react";
import './App.css';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';

const About = () => (
    <div>
    <h2>About</h2>
    <p>This application provides information about the products.</p>
    </div>
    );
    const Products = () => (
    <div>
    <h2>Product List</h2>
       {/* Include your previous table code here */}
    </div>
    );
    
 
export const App = () => {
    const productList = [
      { id: 1, productName: 'Moto G5', quantity: 2, price: 'Rs. 13000' },
      { id: 2, productName: 'Raycold Geyser', quantity: 3, price: 'Rs. 6000'},
      { id: 3, productName: 'Dell Inspiration', quantity: 4, price: 'Rs. 50000'},
    ];
    return (
   <div>
   <h1>Product List</h1>
   <table border="1">
   <thead>
   <tr>
   <th>ID</th>
   <th>Product Name</th>
   <th>Quantity</th>
   <th>Price</th>
   </tr>
   </thead>
   <tbody>
            {productList.map((product) => (
   <tr key={product.id}>
   <td>{product.id}</td>
   <td>{product.productName}</td>
   <td>{product.quantity}</td>
   <td>{product.price}</td>
   </tr>
            ))}
   </tbody>
   </table>
   </div>
    );
   };
